import React from 'react';
import Post from './Post'; // Assuming this is the path to your Post component

const Feed = ({ posts }) => {
  return (
    <div className="feed">
      {posts.map((post) => (
        <Post key={post.firebaseTag} post={post} />
      ))}
    </div>
  );
};

export default Feed;
